import React from 'react'

const CartItem = (props) => {
  return (
    <div>
        <h3>{props.name}</h3>
        <p>{props.description}</p>
        <h5>{props.price}</h5>
        <button>+</button>
        <button>-</button>

    </div>
  )
}

export default CartItem
